<영화_009. 해리포터와 죽음의 성물 1부>
별 3개(★★★)
.
◎ 줄거리
: 덤블도어 교장의 죽음 이후, 
마법부는 죽음을 먹는 자들에게 점령
당하고 호그와트는 위기에 빠진다. 
이에 해리와 론, 헤르미온느는 
볼드모트를 물리칠 수 있는 유일한 단서
이자 그의 영혼이 담긴 성물 
호크룩스를 찾기 위한 위험한 여정에
나선다. 
.
◎ 감상 
: 마지막을 향해 나아간다.
집요정 도비가 그 국민썅년인
벨라트릭스때문에 죽었다.
너도 어떻게 죽는지... 지켜봐주마!
.
사람들은 잡혀가고, 죽어가고!
이제 싸움의 끝은 다가오는데~
.
모든 화면은 
어둠으로 악의 세력을 표현한다.
선과 악의 대결이자 마법세계의
이념전쟁이기도 한 해리와 볼드모트의
싸움!
.
그 와중에 눈길을 끄는 건!!
드레이코 집안의 몰락~
말포이는 어찌할바를 몰라한다. 
또한, 해리를 죽일 수 있는 기회를 
살리는 방향으로 튼다.
많은 망설임과 주저함으로~
호그와트에 다니면서 미운정이 들었나보다..
생각했다.
.
